import axios from "axios";
import Api from "./Api";

const UserApi = async (email, password) => {
  try {
    const result = await Api.post("/login", {
      data: {
        username: email,
        password: password,
      },
      headers: {
        "Content-Type": "application/json",
      },
    });

    return result;
  } catch (error) {
    return error.response.data;
  }
};

export default UserApi;
